package Methods;

public class OOD_Module_5 {
	//

	static void getPoints(String color) {
		if (color == "yellow") {
			System.out.println("earned yellow points");
		} else if (color == "green") {
			System.out.println("earned green points");
		}
	};
	
	
	
public static void main(String[] args) {
		// TODO Auto-generated method stub	
		System.out.println(1.1);
		getPoints("green");	
		System.out.println(1.2);
		
		
		
}// End Main	
} // End Module Class
